public int sig(int[] vs, int p, int t) { 
  if(p == vs.length && t == 0) 
    return 1; 
  else if(p == vs.length) 
    return 0; 
  else 
    return sig(vs, p + 1, t) +  
           sig(vs, p + 1, t - vs[p]); 
}    
